export default function LatticeVector({idx, magnitudes, dims}) {
    return (
        <div className="vectorDisplay">
            <input className="vectorInput" type="number" value={magnitudes[0]}/>
            if(dims) {
                <div>
                <input className="vectorInput" type="number" value={magnitudes[1]}/>
                <input className="vectorInput" type="number" value={magnitudes[2]}/>
                </div>
            }
            else {
                <input className="vectorInput" type="number" value={magnitudes[1]}/>
            }
        </div>
    )
}
